import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import * as serviceWorker from "./serviceWorker";

function MyInfo() {
  return (
    <div>
      <h1>Ronak Gune</h1>
      <p>
        /n I am a recent graduate from SCU and am looking for new opportunities.
      </p>
      <ol>
        <li>Mallorca</li>
        <li>Cannes</li>
        <li>Bali</li>
      </ol>
    </div>
  );
}
ReactDOM.render(<MyInfo />, document.getElementById("root"));
serviceWorker.unregister();
